import "./styles/member.css";
import { useEffect, useState } from "react"; // Import useState and useEffect if needed

const Member = (props) => {
  const { username } = props;
  const latefees = 0;
  return (
    <div className="mainContainer">
      <body>
        <div class="dashboard">
          <div class="left-side">
            <div class="left-item" id="leftItem1">
                <h1>Welcome, {username}</h1>
                <h2>Club Member</h2>
                Late Fees: <span style={{ color: latefees > 0 ? 'red' : 'black' }}>${latefees}</span>
            </div>
            <div class="left-item" id="leftItem2"></div>
          </div>
          <div class="right-side">
            <div class="right-item" id="rightItem"></div>
          </div>
        </div>
      </body>
    </div>
  );
};

export default Member;
